import { Box, Typography } from "@mui/material";

export default function Projects(props) {
    if (props.render === true)
    return (
        <Box
      sx={{
        display: "flex",
        alignItems: "top",
        textAlign: "start",
        bgcolor: "black",
        borderRadius: 5,
        color: "white",
        justifyContent: "space-between",
        padding: "20px 40px 20px 30px",
        marginTop: "10px",
        gap: "10px",
      }}
    >
     
    </Box>
    );

}
